import React from 'react';

const MovieList = (props) => {
	return (
		<>
			{props.movies.map((movie, index) => (
				<div className='movie'>
					<h2>{movie.poster_path}</h2>
				</div>
			))}
		</>
	);
};

export default MovieList;
